kosuperobject.biblemap.put("b14_20_17", new kosuperobject(14,20,17,"이 전쟁에는 너희가 싸울 것이 없나니 항오를 이루고 서서 너희와 함께한 여호와가 구원하는 것을 보라 ! 유다와 예루살렘아 ! 너희는 두려워하며 놀라지 말고 내일 저희를 마주 나가라 여호와가 너희와 함께 하리라 하셨느니라 하매"));
kosuperobject.biblemap.put("b14_20_18", new kosuperobject(14,20,18,"여호사밧이 몸을 굽혀 얼굴을 땅에 대니 온 유다와 예루살렘 거민들도 여호와 앞에 엎드려 경배하고"));
kosuperobject.biblemap.put("b14_20_19", new kosuperobject(14,20,19,"그핫 자손과 고라 자손에게 속한 레위 사람들은 서서 심히 큰 소리로 이스라엘 하나님 여호와를 찬송하니라"));
kosuperobject.biblemap.put("b14_20_20", new kosuperobject(14,20,20,"이에 백성들이 일찌기 일어나서 드고아 들로 나가니라 나갈 때에 여호사밧이 서서 가로되 유다와 예루살렘 거민들아 내 말을 들을지어다 ! 너희는 너희 하나님 여호와를 신뢰하라 ! 그리하면 견고히 서리라 그 선지자를 신뢰하라 ! 그리하면 형통하리라 하고"));
kosuperobject.biblemap.put("b14_20_21", new kosuperobject(14,20,21,"백성으로 더불어 의논하고 노래하는 자를 택하여 거룩한 예복을 입히고 군대 앞에서 행하며 여호와를 찬송하여 이르기를 여호와께 감사하세 ! 그 자비하심이 영원하도다 하게 하였더니"));
kosuperobject.biblemap.put("b14_20_22", new kosuperobject(14,20,22,"그 노래와 찬송이 시작될 때에 여호와께서 복병을 두어 유다를 치러 온 암몬 자손과 모압과 세일산 사람을 치게 하시므로 저희가 패하였으니"));
kosuperobject.biblemap.put("b14_20_23", new kosuperobject(14,20,23,"곧 암몬과 모압 자손이 일어나 세일산 거민을 쳐서 진멸하고 세일 거민을 멸한 후에는 저희가 피차에 살륙하였더라"));
kosuperobject.biblemap.put("b14_20_24", new kosuperobject(14,20,24,"유다 사람이 들 망대에 이르러 그 무리를 본즉 땅에 엎드러진 시체뿐이요 하나도 피한 자가 없는지라"));
kosuperobject.biblemap.put("b14_20_25", new kosuperobject(14,20,25,"여호사밧과 그 백성이 가서 적군의 물건을 취할새 본즉 그 가운 데에 재물과 의복과 보물이 많이 있는 고로 각기 취하는데 그 물건이 너무 많아 능히 가져갈 수 없을만큼 많으므로 사흘 동안에 취하고"));
kosuperobject.biblemap.put("b14_20_26", new kosuperobject(14,20,26,"제 사일에 무리가 브라가 골짜기에 모여서 거기서 여호와를 송축한지라 그러므로 오늘날까지 그 곳을 브라가 골짜기라 일컫더라"));
kosuperobject.biblemap.put("b14_20_27", new kosuperobject(14,20,27,"유다와 예루살렘 모든 사람이 여호사밧을 선두로 즐거이 예루살렘으로 돌아왔으니 이는 여호와께서 저희로 그 적군을 이김을 인하여 즐거워하게 하셨음이라"));
kosuperobject.biblemap.put("b14_20_28", new kosuperobject(14,20,28,"무리가 비파와 수금과 나팔을 합주하고 예루살렘에 이르러 여호와의 전에 나아가니라"));
kosuperobject.biblemap.put("b14_20_29", new kosuperobject(14,20,29,"이방 모든 나라가 여호와께서 이스라엘의 적군을 치셨다 함을 듣고 하나님을 두려워한고로"));
kosuperobject.biblemap.put("b14_20_30", new kosuperobject(14,20,30,"여호사밧의 나라가 태평하였으니 이는 그 하나님이 사방에서 저희에게 평강을 주셨음이더라"));
kosuperobject.biblemap.put("b14_20_31", new kosuperobject(14,20,31,"여호사밧이 유다 왕이 되어 위에 나아갈 때에 나이 삼십 오세라 예루살렘에서 이십 오년을 치리하니라 그 모친의 이름은 아수바라 실히의 딸이더라"));
kosuperobject.biblemap.put("b14_20_32", new kosuperobject(14,20,32,"여호사밧이 그 부친 아사의 길로 행하여 돌이켜 떠나지 아니하고 여호와 보시기에 정직히 행하였으나"));
