kosuperobject.biblemap.put("b14_20_34", new kosuperobject(14,20,34,"이 외에 여호사밧의 시종 행적이 하나니의 아들 예후의 글에 다 기록되었고 그 글은 이스라엘 열왕기에 올랐더라"));
